import "./SearchMoviesButton.css"
import buttonImage from "../images/glass.png"

const SearchMoviesButton = () => {
    return (
        <button><img src={buttonImage} className="glass" alt="significant-glass"/></button>
    )
}

export default SearchMoviesButton
